import React from 'react';
import './App.css';
import Employee from './Counter';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Company Directory</h1>
        <Employee firstName="Magnus"/>
        <Employee firstName="Susann"/>
      </header>
    </div>
  );
}

export default App;
